_('"A classe Enteropneusta engloba espécies solitárias, de corpo vermiforme, comumente alcançando mais de 1 metro de comprimento. Habitam, preferencialmente, fundos rasos, sendo 5 espécies registradas em São Paulo. Balanoglossus gigas, uma das maiores espécies do grupo, podendo atingir 2,5 metros de comprimento, está potencialmente ameaçada no litoral de São Paulo, devido à poluição das águas e do sedimento e ao assoreamento e aterramento das praias." (Rodrigues, 1999). Os excrementos de B. gigas são facilmente visualizados na superfiície descoberta da Baía do Araçá durante as marés baixas.')
