_('<p>Inserida em uma das mais belas e turísticas regiões litorâneas do país – o Litoral Norte do Estado de São Paulo –, a Baía do Araçá (São Sebastião, SP), além de conter remanescentes de manguezal e de abrigar alta diversidade biológica, é também um verdadeiro laboratório a céu aberto e um importante reduto de catadores de moluscos e pescadores artesanais.</p><p>Considerada área natural de expansão do porto, por pouco o Araçá não desapareceu da paisagem de São Sebastião. Em 1987, o aterro da baía, previsto no plano diretor do porto, foi evitado por pressão de ambientalistas e da comunidade científica. Um ano depois, a baía foi secionada por uma desastrosa dragagem para assentamento de um emissário submarino da SABESP, o que provocou danos ecológicos profundos: destruição de habitats e mortandade de organismos. Há vinte anos, o esgoto gerado na região central do município é despejado nas proximidades do Araçá por meio desse emissário que, curiosamente, permanece sem licenciamento ambiental. A tudo isso soma-se a urbanização desordenada, que se encarrega de descaracterizar suas margens e despejar mais lixo e esgoto. Por fim, em 2008, a intenção de aterrar o restante da Baía do Araçá foi anunciada novamente, desta vez no Plano de Desenvolvimento do Porto de São Sebastião, gerido pela Companhia Docas.</p><p>Contudo, este aparente futuro lúgubre não poderia ser mais impróprio. Apesar de poluído e empobrecido, o Araçá insiste em dar mostras de vitalidade. Espécies marinhas que haviam desaparecido em conseqüência da dragagem reapareceram anos após o crime ecológico impune. Garças e colhereiros são vistos com mais freqüência nas águas rasas e lamacentas da baía.</p><p>Embora longe da condição prístina que em parte motivou a criação do CEBIMar na década de 1950, o Araçá continua objeto de estudo e ensino. É um dos mais peculiares ambientes marinhos do litoral – um dos poucos manguezais do canal, onde vivem organismos raramente representados em outros locais. São 733 espécies registradas para a área das quais 34 foram descritas como novas para a ciência; muitas ainda não foram encontradas em outras localidades. Na lista ainda existem espécies de poliquetas, equinodermos e hemicordados ameaçadas de extinção. Por ser uma região de mangue, diversas espécies marinhas passam parte de seu ciclo de vida no local como crustáceos e peixes.</p><p>O Araçá também abriga espécies que servem de recursos naturais como moluscos, camarões e peixes. Pescadores artesanais e catadores de mariscos e siris usufruem da baía nos dias de marés suficientemente baixas e comercializam os produtos em feiras livres, além de consumo próprio.</p><p>Os dados científicos acumulados em mais de 50 anos de pesquisa e os depoimentos da comunidade revelam o quanto a conservação dessa região representa para a Ciência e para a vida de quem dela depende. Nesse sentido, é inquestionável a necessidade premente de se proteger as espécies que teimam em manter a preciosa riqueza da Baía do Araçá.</p><p>Com o aterro do Araçá, além de destruir este complexo ecossistema, os danos ecológicos não ficariam restritos à região. A retificação da linha da costa afetará a dinâmica de sedimentação no canal, possivelmente causando assoreamento ou erosão nas praias e costões adjacentes. A possível e desejada relação entre turismo sustentado e ambiente dificilmente floresce em zonas portuárias e industriais. São Sebastião tem a responsabilidade de manter íntegro o frágil patrimônio ambiental sob sua tutela, para usufruto desta e das gerações futuras.</p>')
