_('<p>Neste tour você pode acompanhar os estágios de vida da bolacha-do-mar <em>Clypeaster subdepressus</em>. Este equinodermo é parente dos ouriços-do-mar, mas seu corpo é achatado e vive semi-enterrado na areia do fundo do mar.</p><p>Os embriões e larvas foram criados em laboratório no CEBIMar e fotografados até se transformarem em pequenos juvenis. Para tal, coletamos os adultos no Canal de São Sebastião (São Sebastião, SP, Brasil) e os induzimos a liberarem seus gametas (óvulos e espermatozóides). Fizemos a fecundação <em>in vitro</em> e acompanhamos o desenvolvimento dos embriões sob microscopia de luz.</p><p>Após as primeiras horas de divisões celulares os embriões tornam-se larvas natantes (plúteos), com cerca de 0,2 mm, que alimentamos com microalgas até sua metamorfose. Dentro da larva começa a crescer uma pequena bolacha-do-mar. Quando os minúsculos pés e espinhos estão formados a larva afunda e sofre a metamorfose. A jovem bolacha-do-mar reabsorve os tecidos larvais e passa a explorar seu novo habitat, entre os grãos de areia.</p>')
